INSERT INTO `bodycontent` VALUES (196609, '<ac:layout><ac:layout-section ac:type=\"single\"><ac:layout-cell><p style=\"margin-left: 60.0px;\">&nbsp;</p><p><span style=\"color: rgb(51,51,51);\">The Confluence editor helps you create content, fast. </span><span style=\"color: rgb(51,51,51);\">You can embed images, Office documents, and even videos. <br />That\'s just the tip of the iceberg when it comes to creating useful content for your team.&nbsp;<br />&nbsp;</span></p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"two_right_sidebar\"><ac:layout-cell><ol><li style=\"text-align: left;\"><strong>Edit</strong> the page.<br /><br /></li><li style=\"text-align: left;\">Click in the right-hand column to position your cursor.<br /><br /></li><li style=\"text-align: left;\">Click <strong style=\"text-align: left;\">Files</strong> on the editor toolbar. It looks like this:<br /><br /><ac:image ac:width=\"301\"><ri:attachment ri:filename=\"step04-01.png\" /></ac:image><br />&nbsp;</li><li style=\"text-align: left;\"><span>The Files dialog shows you the files attached to this page. <br />Select the image named&nbsp;<strong>Confluence Origami Necktie</strong>.<br />&nbsp;<br /></span></li><li style=\"text-align: left;\">Click <strong>Insert</strong>.<br /><br /></li><li style=\"text-align: left;\"><span style=\"color: rgb(51,51,51);\">You will return to this page, and see the \'Image Properties Panel\'. If you don\'t see it, click the image.<br />&nbsp;<br /></span></li><li style=\"text-align: left;\"><span style=\"color: rgb(51,51,51);\">Resize the image by clicking on the square buttons or entering a width.<br /><br /><ac:image ac:width=\"540\"><ri:attachment ri:filename=\"step04-02.png\" /></ac:image><br />&nbsp;<br /></span><span style=\"color: rgb(51,51,51);\"><br /></span></li><li style=\"text-align: left;\"><span>Click <strong>Properties </strong>and then select the <strong>Curl Shadow</strong> option from the Image Effects dialog.&nbsp;<br />&nbsp;&nbsp; <br /></span></li><li style=\"text-align: left;\"><span style=\"color: rgb(51,51,51);\">Your image should look like this when completed:<br /><ac:image ac:queryparams=\"effects=border-simple,shadow-kn\" ac:thumbnail=\"true\" ac:width=\"300\"><ri:attachment ri:filename=\"Confluence-Origami-Necktie.jpeg\" /></ac:image><br />&nbsp;</span></li><li style=\"text-align: left;\"><span style=\"line-height: 1.42857;\">Click&nbsp;</span><strong style=\"line-height: 1.42857;\">Update&nbsp;</strong><span style=\"line-height: 1.42857;\">to publish your changes to the page.</span><br /><br /></li><li style=\"text-align: left;\">View the image on the page, or click to preview the file.</li></ol><p style=\"text-align: left;\">The Files button is not just for images, you can insert and preview a wide range of files, including Microsoft Office documents and PDFs.</p></ac:layout-cell><ac:layout-cell><p>&nbsp;</p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Get serious with a table (step 5 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p></ac:layout-cell></ac:layout-section></ac:layout>', 65562, 2);
INSERT INTO `bodycontent` VALUES (196610, '<p>Page layouts provide structure in your page &mdash; two-column, three-column, and more &mdash; making it easy for anyone to create beautiful pages.</p><p>&nbsp;</p><ol><li><span style=\"color: rgb(51,51,51);\"><strong>Edit</strong>&nbsp;the page.<br />&nbsp;&nbsp;</span></li><li><span style=\"color: rgb(51,51,51);\">Click the <strong>Page Layout</strong></span> button in the editor toolbar. It looks like this:<br /><br /><ac:image ac:thumbnail=\"true\" ac:width=\"160\"><ri:attachment ri:filename=\"step06-image01.png\" /></ac:image><br /><span style=\"color: rgb(51,51,51);\"><br />&nbsp;</span>A section is added to your page, dotted lines indicate the section boundaries.&nbsp;<br />&nbsp;</li><li>Choose a <strong>column layout</strong>&nbsp;to apply to your section, for example two columns. <br /><br /><ac:image ac:width=\"308\"><ri:attachment ri:filename=\"step06-image02.png\" /></ac:image> <br />&nbsp;</li><li><span style=\"color: rgb(51,51,51);\">Click the <strong>Add section</strong> button to add another section to the page. <br /><br /><ac:image ac:width=\"385\"><ri:attachment ri:filename=\"step06-image03.png\" /></ac:image><br />&nbsp;</span></li><li><span style=\"color: rgb(51,51,51);\">Choose a different <strong>column layout</strong> for this section.&nbsp;<br /><br /></span></li><li>Click <strong>Update </strong>to publish your changes to the page.</li></ol><p><span>You can add as many sections as you need, and each section can have a different column layout.&nbsp;</span></p><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Get serious with a table (step 5 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Learn the wonders of autoconvert (step 7 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1>', 65564, 2);
INSERT INTO `bodycontent` VALUES (196611, '<p>&nbsp;</p><p>Let\'s start with the editor. You\'ll use the Confluence editor to <strong>create</strong> and <strong>edit</strong> pages.<br />You can type in the editor as you would in any document, apply formatting, and embed other content and files into the page.</p><p>The editor looks like this <span style=\"color: rgb(153,153,153);\">(click images for a larger view)</span>:</p><p><br /></p><p><ac:image ac:width=\"511\"><ri:attachment ri:filename=\"step-2-image-1.png\" /></ac:image></p><p><br /></p><p><span>Here is a description of the components:</span></p><ol><li><h4><span style=\"color: rgb(0,0,0);\">Editor toolbar</span></h4><span style=\"color: rgb(51,51,51);\">The editor toolbar provides tools to format and color page content, create lists and tables, indent and align text, and insert other content into the page such as symbols, links, images, multimedia files, and macros.<br /><br /><ac:image ac:width=\"870\"><ri:attachment ri:filename=\"step-2-image-3.png\" /></ac:image></span><br /><br /></li><li><h4><span style=\"color: rgb(0,0,0);\">Page content</span></h4><span style=\"color: rgb(51,51,51);\">This is where you and your team will type the content for your page. You can also drag attachments from your desktop here.<br /></span>If other people are editing the page at the same time, you\'ll see their changes in real time!&nbsp;<br /><br /><br /></li><li><h4><span style=\"color: rgb(0,0,0);\">Publish or close</span></h4><span style=\"color: rgb(0,0,0);\">We\'re saving all the time in the editor. &nbsp;Once you\'re ready, hit <strong>publish</strong> to publish your page so others can see the changes, or <strong>close</strong> to finish editing later.<br /><br /><ac:image ac:width=\"800\"><ri:attachment ri:filename=\"step-2-image-5.png\" /></ac:image></span><br /><br /></li></ol><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"What is Confluence? (step 1 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p>', 65566, 2);
INSERT INTO `bodycontent` VALUES (196612, '<ac:layout><ac:layout-section ac:type=\"single\"><ac:layout-cell><p style=\"margin-left: 60.0px;\">&nbsp;</p><p>Insert tables with drag and drop simplicity. <br />Add, remove, cut, and paste rows and columns &ndash; this makes working with tables easy. <br />&nbsp;</p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"two_right_sidebar\"><ac:layout-cell><ol><li><span style=\"color: rgb(51,51,51);\"><strong>Edit</strong>&nbsp;the page.<br />&nbsp;<br /></span></li><li><span style=\"color: rgb(51,51,51);\">Click in the right-hand column to position your cursor.<br />&nbsp;<br /></span></li><li>Click the <strong>Table</strong> menu on the toolbar and drag to choose the size of your table. <br /><br /><ac:image ac:thumbnail=\"true\" ac:width=\"216\"><ri:attachment ri:filename=\"step05-01.png\" /></ac:image><br />&nbsp;</li><li>The table toolbar appears when there is table on your page.<br /><br /></li><li>Place your cursor in the first cell of the table and add a row below it.<br /><br /><ac:image ac:thumbnail=\"true\" ac:width=\"160\"><ri:attachment ri:filename=\"step05-03.png\" /></ac:image><br /><br /></li><li>Place your cursor in any cell of the last column of the table and delete the column.<br /><br /><ac:image ac:thumbnail=\"true\" ac:width=\"160\"><ri:attachment ri:filename=\"step05-04.png\" /></ac:image><br />&nbsp;</li><li>Grab one of the column borders and drag to resize the column.<br /><br /></li><li><span style=\"line-height: 1.42857;\">Click&nbsp;</span><strong style=\"line-height: 1.42857;\">Update&nbsp;</strong><span style=\"line-height: 1.42857;\">to publish your changes to the page.</span></li></ol></ac:layout-cell><ac:layout-cell><p>&nbsp;</p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Prettify the page with an image (step 4 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Lay out your page (step 6 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></span></h1></ac:layout-cell></ac:layout-section></ac:layout>', 65552, 2);
INSERT INTO `bodycontent` VALUES (196613, '<p><br />You can start a discussion by simply leaving a comment on a page, like this one.</p><p>Why not give it a try?</p><p>Go to the bottom of this page and start typing in the comment area. When you\'re finished just press save!&nbsp;</p><p>Don\'t just confine your comments to the bottom of the page - highlight some text on the page to add an inline comment like this:</p><p><br /></p><p><ac:image ac:width=\"417\"><ri:attachment ri:filename=\"Step8-01.png\" /></ac:image></p><p><br /></p><p><strong>Hint:</strong> You can mention another user in a page or&nbsp; comment by typing @ and then the user\'s name. <br />The user will be notified that you mentioned them.</p><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><ac:link><ri:page ri:content-title=\"Learn the wonders of autoconvert (step 7 of 9)\" /><ac:link-body><ac:image ac:height=\"40\" ac:width=\"106\"><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Share your page with a team member (step 9 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p>', 65551, 2);
INSERT INTO `bodycontent` VALUES (196614, '<ac:layout><ac:layout-section ac:type=\"single\"><ac:layout-cell><p><span style=\"color: rgb(64,64,64);\">Confluence automatically transforms linked content</span>&nbsp;<span style=\"color: rgb(64,64,64);\">into rich content.</span>&nbsp;<span style=\"color: rgb(64,64,64);\">Try it with Confluence pages, JIRA issues, YouTube and Vimeo videos,&nbsp;<br /></span><span style=\"color: rgb(64,64,64);\">Flickr photo streams, Tweets, Google maps and many more.</span></p><p><span style=\"color: rgb(64,64,64);\">Here\'s two examples of autoconvert in action.</span></p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"two_equal\"><ac:layout-cell><h3>&nbsp;&nbsp; <br /><ac:structured-macro ac:name=\"widget\" ac:schema-version=\"1\" ac:macro-id=\"974e071d-1a01-4e40-add9-56e8c7fa82cb\"><ac:parameter ac:name=\"url\"><ri:url ri:value=\"http://youtube.com/watch?v=tej3_msu1MY\" /></ac:parameter></ac:structured-macro></h3></ac:layout-cell><ac:layout-cell><p><span style=\"color: rgb(0,0,0);\"> <ac:structured-macro ac:name=\"widget\" ac:schema-version=\"1\" ac:macro-id=\"6f0d84bb-46ee-40a0-8379-fb9a87faf7c7\"><ac:parameter ac:name=\"url\"><ri:url ri:value=\"https://maps.google.com/maps?q=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;hl=en&amp;ll=-33.866572,151.207001&amp;spn=0.004321,0.008256&amp;sll=-33.870509,151.203707&amp;sspn=0.008641,0.016512&amp;oq=atlassian,&amp;hq=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;radius=15000&amp;t=m&amp;z=18&amp;iwloc=A\" /></ac:parameter></ac:structured-macro> </span></p></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"two_equal\"><ac:layout-cell><h3><span style=\"color: rgb(51,51,51);\">Try it yourself:</span></h3><ol><li><span> <span> <span style=\"color: rgb(51,51,51);\"> <span> <strong>Edit</strong>&nbsp;this page.</span> </span> </span> </span></li><li><span> <span> <span style=\"color: rgb(51,51,51);\"> <span>Copy this link&nbsp;<a href=\"https://youtu.be/tej3_msu1MY\">https://youtu.be/tej3_msu1MY</a> and paste it onto the page.</span> <br /> </span> </span> </span></li><li><span style=\"color: rgb(51,51,51);\">Autoconvert will&nbsp;embed the YouTube video on the page.</span></li><li><span style=\"color: rgb(51,51,51);\">Save the page. <br /></span></li></ol></ac:layout-cell><ac:layout-cell><h3><span style=\"color: rgb(51,51,51);\"> <span style=\"color: rgb(51,51,51);\">Try it yourself</span>:</span></h3><ol><li><strong>Edit</strong>&nbsp;this page.</li><li>Copy this link &nbsp;<a href=\"https://maps.google.com/maps?q=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;hl=en&amp;ll=-33.866572,151.207001&amp;spn=0.004321,0.008256&amp;sll=-33.870509,151.203707&amp;sspn=0.008641,0.016512&amp;oq=atlassian,&amp;hq=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;radius=15000&amp;t=m&amp;z=18&amp;iwloc=A\">https://maps.google.com/maps?q=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;hl=en&amp;ll=-33.866572,151.207001&amp;spn=0.004321,0.008256&amp;sll=-33.870509,151.203707&amp;sspn=0.008641,0.016512&amp;oq=atlassian,&amp;hq=Atlassian,+George+Street,+New+South+Wales,+Australia&amp;radius=15000&amp;t=m&amp;z=18&amp;iwloc=A</a>&nbsp;and paste it onto the page.&nbsp;</li><li>Autoconvert will render the Google Maps view on the page.</li><li><span style=\"color: rgb(51,51,51);\">Save the page. <br /></span></li></ol></ac:layout-cell></ac:layout-section><ac:layout-section ac:type=\"single\"><ac:layout-cell><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"> <br /> </span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"> <ac:link><ri:page ri:content-title=\"Lay out your page (step 6 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Tell people what you think in a comment (step 8 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link> </span></h1><p><span style=\"color: rgb(51,51,51);\"> <br /> </span></p></ac:layout-cell></ac:layout-section></ac:layout>', 65558, 2);
INSERT INTO `bodycontent` VALUES (196615, '<p><span style=\"color: rgb(64,64,64);\"><br /></span></p><p><span style=\"color: rgb(64,64,64);\">Once you\'ve created content you\'ll want to share it with your team members.&nbsp;<br /></span><span style=\"color: rgb(64,64,64);\">Confluence can do all the work for you, just click the <strong>Share</strong> button.<br /></span></p><p style=\"margin-left: 30.0px;\"><span style=\"color: rgb(64,64,64);\"><span style=\"color: rgb(64,64,64);\"><br /></span></span></p><ol><li>Let\'s tell someone about this page. <br />Click the <strong>Share</strong> button at the top right of the page. It looks like this:<br /><br /><ac:image ac:width=\"379\"><ri:attachment ri:filename=\"step09-01.png\" /></ac:image><br />&nbsp;</li><li>Type the name of the person or group you want to share the page with. <br />You can also enter an email address. <br /><br /></li><li>Add a message to give the person some background about the page.<br /><br /></li><li>Click the <strong>Share</strong> button. <br />Confluence will send the person an email message about this page. Shared!</li></ol><p>&nbsp;</p><p><img class=\"emoticon emoticon-warning\" title=\"(warning)\" src=\"http://localhost:8090/s/en_GB/7502/10587128b0de2a71f82b5acc129b8b5611829c93/_/images/icons/emoticons/warning.png\" alt=\"(warning)\" border=\"0\" /><span style=\"color: rgb(64,64,64);\"> If your administrator has not added a mail server, the&nbsp;</span><strong>Share</strong><span style=\"color: rgb(64,64,64);\"> button will only show the share link.<br /></span></p><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"Tell people what you think in a comment (step 8 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;</span></h1><p style=\"margin-left: 30.0px;\"><span style=\"color: rgb(51,51,51);\"><br /></span></p>', 65550, 2);
INSERT INTO `bodycontent` VALUES (196616, '<p style=\"text-align: center;\">&nbsp;</p><h2><ac:image><ri:attachment ri:filename=\"welcome.png\" /></ac:image><br />&nbsp; <span style=\"color: rgb(128,128,128);\">With Confluence it is easy to create, edit and share content with your team. <br />&nbsp; Choose a topic below to start learning how.</span></h2><h2><span style=\"color: rgb(0,0,128);\"><br /></span></h2><ol><li><span style=\"color: rgb(0,0,128);\"><ac:link><ri:page ri:content-title=\"What is Confluence? (step 1 of 9)\" /><ac:link-body>What is Confluence?<br /><br /></ac:link-body></ac:link></span></li><li><span style=\"color: rgb(0,0,128);\"><ac:link><ri:page ri:content-title=\"A quick look at the editor (step 2 of 9)\" /><ac:plain-text-link-body><![CDATA[A quick look at the editor]]></ac:plain-text-link-body></ac:link><br />&nbsp;</span></li><li><span style=\"color: rgb(0,0,128);\"><ac:link><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /><ac:plain-text-link-body><![CDATA[Let\'s edit this page]]></ac:plain-text-link-body></ac:link><br /><br /></span></li><li><span style=\"color: rgb(0,0,128);\"><ac:link><ri:page ri:content-title=\"Prettify the page with an image (step 4 of 9)\" /><ac:link-body>Prettify the page with an image<br /><br /></ac:link-body></ac:link></span></li><li><span style=\"color: rgb(0,0,128);\"><ac:link><ri:page ri:content-title=\"Get serious with a table (step 5 of 9)\" /><ac:link-body>Get serious with a table<br /></ac:link-body></ac:link></span><span style=\"color: rgb(0,0,128);\">&nbsp;</span></li><li><span style=\"color: rgb(0,0,128);\"><ac:link><ri:page ri:content-title=\"Lay out your page (step 6 of 9)\" /><ac:plain-text-link-body><![CDATA[Lay out your page]]></ac:plain-text-link-body></ac:link>&nbsp;<br /><br /></span></li><li><ac:link><ri:page ri:content-title=\"Learn the wonders of autoconvert (step 7 of 9)\" /><ac:plain-text-link-body><![CDATA[Learn the wonders of autoconvert]]></ac:plain-text-link-body></ac:link>&nbsp;<br /><br /></li><li><ac:link><ri:page ri:content-title=\"Tell people what you think in a comment (step 8 of 9)\" /><ac:plain-text-link-body><![CDATA[Tell people what you think in a comment]]></ac:plain-text-link-body></ac:link>&nbsp;<br /><br /></li><li><ac:link><ri:page ri:content-title=\"Share your page with a team member (step 9 of 9)\" /><ac:plain-text-link-body><![CDATA[Share your page with a team member]]></ac:plain-text-link-body></ac:link></li></ol><p><span style=\"color: rgb(128,128,128);\"><br /></span></p><p><span style=\"color: rgb(128,128,128);\"><br /></span></p><p><span style=\"color: rgb(128,128,128);\"><br /></span></p><p><span style=\"color: rgb(128,128,128);\"><br /></span></p><p><span style=\"color: rgb(128,128,128);\"><br /></span></p><p style=\"text-align: right;\">&nbsp; &nbsp; &nbsp;&nbsp;</p>', 65557, 2);
INSERT INTO `bodycontent` VALUES (196617, '<p style=\"margin-left: 60.0px;\">&nbsp;</p><p><strong>Confluence</strong> is where you can create, organize and discuss work with your team. <br />Use Confluence for meeting notes, project plans, requirements, sprint planning, how-to guides, or anything you like.</p><p>Click the <strong>Create</strong> button on the header to see some of the types of pages you can create.</p><p>A Confluence page can contain text, images, diagrams, activity streams, videos, and more. <br />Confluence puts your content online in a central place where your team can search, edit and discuss it at any time. <span><span style=\"color: rgb(0,0,0);\">&nbsp;</span></span></p><p><span><span style=\"color: rgb(0,0,0);\">So let\'s try it!<span style=\"color: rgb(0,0,255);\">&nbsp;<ac:link><ri:page ri:content-title=\"A quick look at the editor (step 2 of 9)\" /><ac:plain-text-link-body><![CDATA[Click here to learn how to edit a page]]></ac:plain-text-link-body></ac:link></span>&nbsp;</span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\">&nbsp;</span></span></p><h1 style=\"text-align: center;\"><ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"A quick look at the editor (step 2 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\"><ri:page ri:content-title=\"Let\'s edit this page (step 3 of 9)\" /></ri:attachment></ac:image></ac:link-body></ac:link></h1><p><span style=\"color: rgb(51,51,51);\"><br /></span></p><p><span style=\"color: rgb(51,51,51);\"><br /></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p><p><span style=\"color: rgb(153,153,153);\"><span style=\"color: rgb(0,0,0);\"><br /></span></span></p>', 65556, 2);
INSERT INTO `bodycontent` VALUES (196618, '<p style=\"margin-left: 60.0px;\">&nbsp;</p><p>Pages live in spaces. This page is in the \'Demonstration Space\'.&nbsp;<br />&nbsp;</p><p>Let\'s play with some content. Don\'t worry, you won\'t break anything:</p><ol><li>Click&nbsp;<strong>Edit</strong> at the top of this page. Now you\'re in the editor.<br /><br /></li><li>Type some words anywhere on the page.<br /><br /></li><li>Have some fun:<span style=\"line-height: 0.0px;\">&nbsp;</span></li></ol><ul><li style=\"list-style-type: none;\"><ul><li>Change the color of the text: Select the text, then choose a color from the color option in the editor tool bar.<br /><br /></li><li>Add a link: Select some text, then choose the <strong>Link</strong> button on the toolbar.<br />Click <strong>Web Link</strong> and enter an <strong>Address</strong>, such as&nbsp;<code>http://www.atlassian.com</code>. <br />Click <strong>Insert</strong> to insert the link.<br /><br /></li><li>Find a file or picture on your computer, and drag it anywhere on this page.<br /><br /></li><li>Try some of the other options on the editor toolbar.</li></ul></li></ul><p>When<em> y</em>ou\'re ready, click <strong>Update</strong> to publish your changes then<strong>&nbsp;</strong>and go to the next step or back to the space home.</p><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><br /></span></h1><h1 style=\"text-align: center;\"><span style=\"color: rgb(51,51,51);\"><ac:link><ri:page ri:content-title=\"A quick look at the editor (step 2 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"prev.jpg\" /></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Welcome to Confluence\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"home.jpg\" /></ac:image></ac:link-body></ac:link>&nbsp;<ac:link><ri:page ri:content-title=\"Prettify the page with an image (step 4 of 9)\" /><ac:link-body><ac:image><ri:attachment ri:filename=\"next.jpg\" /></ac:image></ac:link-body></ac:link></span></h1><p>&nbsp;</p>', 65563, 2);
